ll id(ll num) {
    int len = 0, oneNum = 0;
    while (num > 0) {
        oneNum += (num & 1);
        len++; num >>= 1;
    }
    return (oneNum - 1) * 61 + len;
}

int main() {
    ll num; cin >> num;
    cout << arr[id(num)] << '\n';
    return 0;
}